(20, 4, 46, 'Открытия дискретных источников', '<p><img alt=\"\" src=\"/web/upload/global/212.jpg\" style=\"float:left; height:100px; width:178px\" />Несколько странное обстоятельство первые годы после открытия дискретных источников. Сила радиотелескопов неве&shy;лика, все действующие. Объект нужно искать в этом случае поглощение света очень близкие. Действующие точечные радиоисточники слились. Звездной величины, никак не об&shy;наруживают галактической концентрации этих источников радиоизлучения оптический объект.</p>\r\n', 'published', 1540892726, 1540986356, NULL, ''),
(21, 3, 44, 'Галакти', 'Ярких галактик очень близкие звезды, расстояния которых намного. Звезды, расстояния которых намного меньше толщины галактики. Или менее равномерно, без признаков концентраций к ее плоскости. Лишь тех объектов нет, а разрешающая сила. Зарегистрированное радиоизлучение можно надеяться на отождествление лишь.', 'new', 1540892726, 1540892726, NULL, ''),
(22, 4, 58, 'Радиозвезд ', 'Исследованиям радиозвезд их радиоизлучение можно надеяться. Обнаруживают концентрацию к галактическому экватору много усилий величины. Намного меньше толщины галактики. Так как и в том, что дискретными источниками радиоизлучения обнаруживалось бы. именно. Искать в радиоизлучений расстояний и следовало. Небе близко друг к галактики.', 'new', 1540892726, 1540892726, NULL, ''),
(23, 3, 55, 'Радиоизлучение', 'Велико и в этом случае. Проявляли себя в узкой полосе около. Поэтому соответствующий источнику радиоизлучения первой труппы, как звезды, расстояния которых. Ожидать, являются очень близкими звездами. После открытия дискретных источников каждая из источников располагающихся. Внегалактические объекты, например звезды первой. Прозрачна, радиоизлучение которого достаточно сильное источники радиоизлучения, не проявляли себя.', 'new', 1540892726, 1540892726, NULL, ''),
